import { deleteCartProduct } from "../../services/cart.js";
import { useEffect } from "react";

export function delCartProduct(productId) {
    deleteCartProduct(productId);

    async function fetchDelCartProducts() {
        await deleteCartProduct();
    }
    
    useEffect(() => {
        fetchDelCartProducts();
    }, []);
}

module.exports = { delCartProduct };
